function DataInsertAxios() {
  var reqStandardRadio1 = document.getElementById('radio_1');
  var reqStandardRadio2 = document.getElementById('radio_2');
  var reqStandardRadio3 = document.getElementById('radio_3');
  var reqStandard = null;

  if (reqStandardRadio1.checked == true) {
    reqStandard = '주거공간';
  } else if (reqStandardRadio2.checked == true) {
    reqStandard = '상업공간';
  } else if (reqStandardRadio3.checked == true) {
    reqStandard = '주거공간';
  }

  var reqName = document.getElementById('reqname').value;
  var reqPhone = document.getElementById('reqphone').value;
  var reqMemo = document.getElementById('reqmemo').value;
  var reqAddress = document.getElementById('reqaddress').value;
  var reqMeasure = document.getElementById('reqmeasure').value;
  var reqDate = document.getElementById('reqdate').value;

  if (reqName == "") {
    alert('성함을 입력해주세요');
  } else if (reqPhone == "") {
    alert('연락처를 입력해주세요');
  } else if (reqStandard == null) {
    alert('상담을 선택해주세요');
  } else {
    var DataObj = {
      reqStandard: reqStandard,
      reqName: reqName,
      reqPhone: reqPhone,
      reqMemo: reqMemo,
      reqAddress: reqAddress,
      reqMeasure: reqMeasure,
      reqDate: reqDate,
      reqTit: reqStandard + " " + reqAddress + " " + reqMeasure
    };
    var baseURI = 'insert/insert.php';
    axios.post("" + baseURI, DataObj).then(function (result) {
      if (result.data.phpResult == 'ok') {
        alert('상담 신청이 완료되었습니다.');
        location.reload();
      }
      else{
        alert('상담 요청이 실패하였습니다. 관리자에게 문의해주세요');
      }
    }).catch(function (err) {
      return console.log('Login: ', err);
    });
  }
};